            </View>
          </View>

          <View></View>

          <View>
          </View>
          <View>
          </View>
        </View>
      </ScrollView>

      <Navbar navigation={navigation} />
    </LinearGradient>
  );
};

const styles = StyleSheet.create({
  imgProfile:{
      backgroundColor: "#1a396e",
      flexDirection: 'row',
      height: 55,
  },
})
export default Account;
